import "./task-list.css";
import Task from "../task";

const TodoList = () => {
  return (
    <ul className="todo-list">
      <Task label="Completed task" className="completed" />
      <Task label="Editing task" />
      <Task label="Active task" />
    </ul>
  );
};

export default TodoList;
